import { gql } from '@apollo/client';
import { siteNavVariant } from './constants';

export const GET_BRAND_NAV = gql`
	query GetNav {
		{
			navigationCfModelList(filter: {_variation: {_expressions: [{value: "${siteNavVariant}", _ignoreCase: true}]}}) 
			{
			  items {
				generatedNavigationList
			  }
			}
		}
	}
	`;
